import { HOUSE_ITEM_CHANGE } from "./house-constats";
import { IHouseAction, THouseState } from "./house-types";

const houseDefaultState: THouseState = [
  {
    id: "garage",
    name: "Гараж",
    cost: 123,
    active: false,
    coordinates: [90, 0],
    src:
      "data:image/jpeg;base64,"
  },
  {
    id: "bathhouse",
    name: "Душевая",
    cost: 234,
    active: false,
    coordinates: [100, 100],
    src:
      "data:image/jpeg;base64,"
  },
  {
    id: "pergola",
    name: "Беседка",
    cost: 345,
    active: false,
    coordinates: [360, -100],
    src:
      "data:image/jpeg;base64,"
  },
  {
    id: "changeHouse",
    name: "Бытовка",
    cost: 456,
    active: false,
    coordinates: [350, -5],
    src:
      "data:image/png;base64,"
  }
];

export const houseReducer = (
  state: THouseState = houseDefaultState,
  action: IHouseAction
) => {
  switch (action.type) {
    case HOUSE_ITEM_CHANGE: {
      return state.map(
        item =>
          item.id === action.itemId ? { ...item, active: !item.active } : item
      );
    }

    default:
      return state;
  }
};
